import React from "react";

 

export default function Frag (props){
    return(
        <div className="jok">
         <img src={`../img/${props.img}`} className="yourClassName" />
        
         <div>
         <img src="../img/Star.png"/>
     
            <span> </span>
            <span className="gray"> ({props.revcount}). </span>
            <span className="gray" >{props.country} </span>
         </div>
         <p> {props.title}</p>
         <p> {props}</p>


          

        </div>
        
    )

}
